description:
Seattle is a fan favorite on the Red Bull Global Rallycross schedule, providing the perfect muddy backdrop for high-intensity wheel to wheel competition. As the second to last event on the 2014 schedule, a win in the Pacific Northwest can go a long way for any driver looking to mount a late charge for the championship.
